import React from 'react';
import './App.css';
import {Event} from './components/index'

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";


function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Route path="/event">
            <Event/>
          </Route>
          <Route path="/" exact component={Home}>
            <Event/>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
